import React, { useState, useEffect } from 'react';

export default function WeightExercise(props) {
  // Destructure the props to extract the name and image
  const { name, img } = props.selectedWorkout;

  // State variables to keep track of the input values and exercise state
  const [weight, setWeight] = useState(0);
  const [reps, setReps] = useState(0);
  const [holdTime, setHoldTime] = useState(0);
  const [isLifting, setIsLifting] = useState(false);
  const [isHolding, setIsHolding] = useState(false);
  const [isBreaking, setIsBreaking] = useState(false);
  const [timer, setTimer] = useState(0);

  // Function to handle the form submission
  const handleSubmit = (event) => {
    event.preventDefault(); // prevent the default form submission behavior
    setIsLifting(true); // start lifting
    setTimer(3); // set countdown to 3 seconds
  };

  // Function to handle the weight input change
  const handleWeightChange = (event) => {
    setWeight(event.target.value);
  };

  // Function to handle the reps input change
  const handleRepsChange = (event) => {
    setReps(event.target.value);
  };

  // Function to handle the hold time input change
  const handleHoldTimeChange = (event) => {
    setHoldTime(event.target.value);
  };

  // Countdown effect for lifting
  useEffect(() => {
    let timerId;
    if (isLifting && timer > 0) {
      timerId = setTimeout(() => {
        setTimer(timer - 1);
      }, 1000);
    } else if (isLifting && timer === 0) {
      setIsLifting(false);
      setIsHolding(true);
      setTimer(holdTime); // start holding for the specified hold time
    }
    return () => {
      clearTimeout(timerId);
    };
  }, [isLifting, holdTime, timer]);
useEffect(() => {
    let timerId;
    if (isHolding && timer > 0) {
      timerId = setTimeout(() => {
        setTimer(timer - 1);
      }, 1000);
    } else if (isHolding && timer === 0) {
      setIsHolding(false);
      setIsBreaking(true);
      setTimer(60); // start break for 60 seconds
    }
    return () => {
      clearTimeout(timerId);
    };
  }, [isHolding, timer]);

  // Countdown effect for breaking
  useEffect(() => {
    let timerId;
    if (isBreaking && timer < 60) {
      timerId = setTimeout(() => {
        setTimer(timer + 1);
      }, 1000);
    } else if (isBreaking && timer === 60) {
      setIsBreaking(false);
      setReps(reps - 1); // increment the reps
    }
    return () => {
      clearTimeout(timerId);
    };
  }, [isBreaking, reps, timer]);

   const handleRestartClick = () => {
    setIsBreaking(false);
    if (reps > 0) {
      setIsLifting(true);
      setTimer(3);
    } else {
      setReps(0);
    }
  };

  // Function to handle the continue button click
  const handleContinueClick = () => {
    setIsBreaking(false);
    setIsLifting(true);
    setTimer(3);
  };
 return (
  <div>
    <h2>{name}</h2>
    <img
      src={
        isLifting
          ? img[1].name
          : isHolding
          ? img[0].name
          : img[2].name
      }
      alt={name}
    />

    <form onSubmit={handleSubmit}>
      <label>
        Weight:
        <input type="number" value={weight} onChange={handleWeightChange} />
      </label>
      <br />
      <label>
        Reps:
        <input type="number" value={reps} onChange={handleRepsChange} />
      </label>
      <br />
      <label>
        Hold time:
        <input type="number" value={holdTime} onChange={handleHoldTimeChange} />
      </label>
      <br />
      {!isLifting && !isHolding && !isBreaking && (
        <button type="submit">Start exercise</button>
      )}
      {isLifting && <p>Lifting {timer}...</p>}
      {isHolding && <p>Hold for {timer}...</p>}
      {isBreaking && (
        <div>
          <p>
            {reps > 0
              ? `Do you want to continue for ${reps} more reps?`
              : "You're done! Restart or exit?"}
          </p>
          {reps > 0 ? (
            <button onClick={handleContinueClick}>Continue</button>
          ) : (
            <button onClick={handleRestartClick}>Restart</button>
          )}
          <button onClick={handleExitClick}>Exit</button>
        </div>
      )}
    </form>
  </div>
);

    }
